import React from 'react';
import { Link } from 'react-router-dom';
import Logo from '../Logo/Logo';

const Main = ({ children, user }) => (
  <>
  <Logo></Logo>
    <Link to='/users'>{user ? user.name : 'Who are you ?'} </Link>
  </>
);

export default Main;
